import React from 'react';
function Brokerage() {
    return (  
        <div className="container">
      <div className="row mt-5 text-center">
        <div className="col-8 mt-5">
            <h4>Brokerage Calculator</h4>
        </div>
        <div className="col-4 mt-5">
            <h3>List of charges</h3>
        </div>
      </div>
    </div>
    );

}

export default Brokerage;
